import React, { useState } from 'react';
import ReactMapGL from 'react-map-gl';

function Map() {
  const MAPBOX_TOKEN = 'sk.eyJ1IjoiZmVyb3BlcyIsImEiOiJjbHZ0anJ3cHIwMGEzMmpuZTY3Nms2ZzF3In0.mWSZNW1iPpx6-D5i7mxkTQ';
  const [viewport, setViewport] = useState({
    width: '100%',
    height: 400,
    latitude: 37.742828,
    longitude: -25.680588,
    zoom: 8
  });

  return (
    <ReactMapGL
      {...viewport}
      mapboxApiAccessToken={MAPBOX_TOKEN}
      onViewportChange={(nextViewport) => setViewport(nextViewport)}
    />
  );
}

export default Map;
